import { Component,OnInit } from '@angular/core';


@Component({
  selector: 'app-qlsp',
  templateUrl: './qlsp.component.html',
  styleUrls: ['./qlsp.component.css']
})

export class QlspComponent {
  watches = [
    { name: 'Đồng hồ Rolex', price: 2000, imageUrl: 'https://via.placeholder.com/150' },
    { name: 'Đồng hồ Casio', price: 100, imageUrl: 'https://via.placeholder.com/150' },
    { name: 'Đồng hồ Omega', price: 3000, imageUrl: 'https://via.placeholder.com/150' },
    { name: 'Đồng hồ Seiko', price: 150, imageUrl: 'https://via.placeholder.com/150' },
    { name: 'Đồng hồ Citizen', price: 120, imageUrl: 'https://via.placeholder.com/150' }
  ];

  print(): void {
    window.print();
  }
}
